import { Component } from "react";
import "./card.styles.css";

class Card extends Component {
  render() {
    const {id , name , email ,wantedWidth} = this.props;

    return (
      <div className="card-container-father">
      <div className="card-container-father">
        <div className="card-container" key={id}>
          <img
            alt={`host ${name}`}
            src={`https://cdn-icons-png.flaticon.com/512/915/915974.png?w=360`}
            width={wantedWidth}
          />
          <h2>{name}</h2>
          <p>{email}</p>
          <p>{email}</p>
        </div>
      </div>  
      </div>  
    );
  }
}

export default Card;
